class Solution {
    public long maxBalancedSubsequenceSum(int[] nums) {
        long maxNegative = Long.MIN_VALUE;
        long totalPositive = 0;
        boolean hasPositive = false;
        for (int num : nums) {
            if (num >= 0) {
                totalPositive += num;
                hasPositive = true;
            } else {
                maxNegative = Math.max(maxNegative, num);
            }
        }
        if (hasPositive) {
            return totalPositive;
        } else {
            return maxNegative;
        }
    }
}
